library(dslabs) data(“mtcars”)
custom_summary &lt;- function (carCustom) { meanValue &lt;- mean(carCustom) std &lt;- sd(carCustom) maxValue &lt;- max(carCustom) minValue &lt;- min(carCustom) medianValue &lt;- median(carCustom) customStatistics &lt;- list(minValue,maxValue,meanValue,medianValue,std) return (customStatistics) } customNames &lt;- names(mtcars) for (customIndex in 1:11){ carCustom &lt;- mtcars[,customIndex] customStatistics &lt;- custom_summary(carCustom) print(customNames[customIndex]) print(customStatistics) }
qq &lt;- apply(mtcars,2,custom_summary) print(qq)
